import logo from "./logo.svg";
import { YoutubeData } from "./YoutubeData";
import "./App.css";

/**
 * element = <div id = "root"> hello world</div>
 * element = React.createElement("div", {id: 'root'}, 'Hello world');
 *
 */

function App() {
  console.log(YoutubeData);
  return (
    // children component
    <div className="list">
      {YoutubeData.map((item, index) => (
        <Youtube image={item.image}></Youtube>
      ))}
    </div>
  );
}

function Youtube(props) {
  console.log(props);
  return (
    <div className="youtube-item">
      <div className="youtube-img">
        <img src={props.image} alt="youtube" />
      </div>
      <div className="youtube-title">
        <h2>{props.title || "This is example of title"}</h2>
      </div>
      <div className="youtube-footer">
        <div className="youtube-avata">
          <img src={props.avata} alt="" />
        </div>
        <div className="youtube-author">
          <h3>{props.author || "This is example of author"}</h3>
        </div>
      </div>
    </div>
  );
}

export default App;
